class Vector2{constructor(x,y){return this.x=x,this.y=y,this}set(x,y){return this.x=x,this.y=y,this}copy(v){return this.x=v.x,this.y=v.y,this}clone(){return new Vector2(this.x,this.y)}add(v){return this.x+=v.x,this.y+=v.y,this}}class Vector3{constructor(x,y,z){return this.x=x,this.y=y,this.z=z,this}set(x,y,z){return this.x=x,this.y=y,this.z=z,this}copy(v){return this.x=v.x,this.y=v.y,this.z=v.z,this}clone(){return new Vector3(this.x,this.y,this.z)}add(v){return this.x+=v.x,this.y+=v.y,this.z+=v.z,this}}class canvasPos{constructor(x,y){return this.x=x,this.y=y,this}}